    [],nt"revision_timestamp": "2016-10-15T16:36:26.430264",nt"name": "moosehorn-national-wildlife-refuge-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Moosehorn
    National Wildlife Refuge outlines Refuge accomplishments during the 1987 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses management planning and research
    and investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, grazing,
    haying, fire management, pest control, and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, wildlife propagation, scientific collections, animal control, and marking
    and bird banding. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment replacement, and energy conservation. Cooperative programs and items of
    interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
